import React from 'react';
import { Provider } from 'react-redux';
import ProductList from './components/ProductList';
import { store } from './store';


function App() {
  return (
    <Provider store={store}>
      <div className='bg-stone-900 min-h-screen'>
        <ProductList />
      </div>
    </Provider>
  )
}

export default App;
